// Helper function to get scenario by recordId
window.getScenarioByRecordId = function(recordId) {
  for (var scenarioName in window.PMS_MASTER_DATA.scenarios) {
    var scenario = window.PMS_MASTER_DATA.scenarios[scenarioName];
    if (scenario.recordId === recordId) {
      return scenario;
    }
  }
  return null;
};

// Helper function to get scenario by name
window.getScenarioByName = function(name) {
  return window.PMS_MASTER_DATA.scenarios[name] || null;
};
